import React from 'react'
import Loading from './Loading';
import getWeatherIcon from "./GeneralIncludes";

export default function WeatherPage({data, loading, error404, error503, reversedGeolocation, sunrise, sunset}) {
    let today = new Date();
    var timeHour = today.getHours() + ":" + today.getMinutes()

    let temperature = "";
    if(data?.temp !== undefined){
        temperature = <p>{Math.round(data?.temp)} °C</p>
    }else if (data?.main?.temp !== undefined) {
        temperature = <p>{Math.round(data?.main?.temp)} °C</p>
    }else{

    }

    let city;
    if (loading !== true){
        city = <h1 className="city">{reversedGeolocation}</h1>
    }

    let sunsetHour;
    let sunriseHour;
    function getTime(s) {
        const dtFormat = new Intl.DateTimeFormat('sv-SE', {
          timeStyle: 'medium',
          timeZone: 'GMT'
        });

        let newSunset = new Date(sunset * 1000)
        let newSunrise = new Date(sunrise * 1000)
        sunsetHour = newSunset.getHours();
        sunriseHour = newSunrise.getHours();
      }
      getTime(sunset);
      getTime(sunrise);

    let weather_description;
    let icon;
    if(data?.weather?.[0]?.description !== undefined){
        weather_description = data?.weather?.[0]?.description
        function capitalize(){
            weather_description = weather_description.charAt(0).toUpperCase() + weather_description.slice(1);
            return <p>{weather_description}</p>
        }

        let today = new Date();
        var currentHour = today.getHours();

        if(currentHour[0] === 0){
            currentHour = currentHour.slice(0);
        }

        // För att kolla vad responsen ger för väder beskrivning och returnera rätt ikon
        icon = getWeatherIcon(currentHour, sunriseHour, sunsetHour, weather_description)

        capitalize();
    }

    let precipitation;
    if(data.snow?.["1h"] !== undefined){
        precipitation = (data.snow?.["1h"].toFixed(1));
    }else{
        precipitation = 0;
    }

    if(data?.rain?.["1h"] !== undefined){
        precipitation = (data?.rain?.["1h"].toFixed(1));
    }else{
        precipitation = 0;
    }

    let wind = Math.round(data?.wind_speed);

    let errorMessage404 =
        <div className="error">
            <p>Vi kunde tyvärr inte hitta den angivna staden :(</p>
        </div>

    let errorMessage503 =
        <div className="grey">
            <div className="error503-div">
                <p>Ett fel uppstod, vänligen försök igen senare</p>
                <button onClick={() => window.location.reload(false)}>Ladda om sidan</button>
            </div>
        </div>

    return (
        <>
            {error503 &&
                errorMessage503
            }
            {error404 ?
                errorMessage404
            :
            <>
                {loading || temperature === "" &&
                    <>
                        <Loading />
                    </>
                    // <div className="grey-loading">
                    // </div>
                }
                <div className="current-place-weather-info">
                    {city}
                    {icon}
                    <p>{weather_description}</p>
                    <div className="precipitation-div">
                        <div className="more-info-div">
                            {data?.temp <= 0 ?
                                <img className="precipitation-img" alt="icon" src="data:image/svg+xml;base64," />
                            :
                                <img className="precipitation-img" alt="icon" src="data:image/svg+xml;base64," />
                            }
                            {temperature}
                        </div>
                        <div className="more-info-div">
                            <img className="precipitation-img" alt="icon" src="data:image/svg+xml;base64," />
                            <p> {precipitation} mm</p>
                        </div>
                        <div className="more-info-div">
                            <img className="precipitation-img" alt="icon" src="data:image/svg+xml;base64," />
                            <p> {wind} m/s</p>
                        </div>
                    </div>
                </div>
                
            </>
            }
        </>
    )
}
